### Step 2: Create the Data Storage

Create a new file called `DreamStore.js` to handle data storage using AsyncStorage.

```javascript
// DreamStore.js
import AsyncStorage from '@react-native-async-storage/async-storage';

const DREAMS_KEY = '@dreams_key';

const getDreams = async () => {
  const jsonValue = await AsyncStorage.getItem(DREAMS_KEY);
  return jsonValue ? JSON.parse(jsonValue) : [];
};

const addDream = async (dream) => {
  const currentDreams = await getDreams();
  const updatedDreams = [...currentDreams, dream];
  await AsyncStorage.setItem(DREAMS_KEY, JSON.stringify(updatedDreams));
  return updatedDreams;
};

const deleteDream = async (id) => {
  const currentDreams = await getDreams();
  const filteredDreams = currentDreams.filter(dream => dream.id !== id);
  await AsyncStorage.setItem(DREAMS_KEY, JSON.stringify(filteredDreams));
  return filteredDreams;
};

